import * as React from "react";
import Link from "next/link";
import { ToggleTheme } from "./theme-toggle";

const Header = (props) => {
  return (
    <>
      <header>
        <div className="logo">
          <img src="/naveenda-logo.svg" />
        </div>
        <ul className="links">
          <li>
            <Link href="/">Portfolio</Link>
          </li>
          <li>
            <Link href="/photography">Photography</Link>
          </li>
          <li>
            <Link href="/">Drawing</Link>
          </li>
          <li>
            <Link href="https://twitter.com/NaveenDA_">Contact Me</Link>
          </li>
          <li>
            <ToggleTheme />
          </li>
        </ul>
      </header>
      <style jsx>
        {`
          header {
            height: 45px;
            line-height: 45px;
            display: flex;
          }
          header .logo {
            flex: 0 200px;
            font-family: "Engagement", cursive;
            padding-left: 45px;
            font-size: 22px;
          }
          header .logo img {
            height: 38px;
            vertical-align: bottom;
          }
          header .links {
            flex: 0 calc(90vw - 200px);
            padding-right: 45px;
            text-align: right;
          }
          header .links ul {
            list-style-type: none;
            background: red;
            display: block;
            height: 45px;
            margin-top: 0;
          }
          header .links li {
            display: inline;
            padding-left: 12px;
          }

          @media only screen and (max-width: 600px) {
            header .links {
              flex: 0 calc(100vw - 200px);
            }
            header .links li a {
              font-size: 9px;
            }
          }
        `}
      </style>
    </>
  );
};
export default Header;
